INSERT INTO `custom` VALUES (15,'Arkveld','Grande','Cuanta ms energa absorbe este monstruo, ms feroces son sus ataques. Con los tanques de energa llenos, sus afilados cadenculos se despliegan para llegar ms lejos. A su vez, dado que sus alas tienen rganos que absorben energa, es posible derramarla concentrando tus ataques sobre ellos. Los ataques elementales continuos sobrecargan los rganos, lo que devuelve al monstruo a su estado normal.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcTIoVGDYlvS7_q_6ctER2h5spM211kumKRNGA&s','juancarlosfilter@gmail.com','2025-05-22 16:46:16'),(16,'Rey Dau','Grande','Wyvern volador que ejerce su supremaca en el ecosistema de los Llanos Barlovento. Se ha adaptado a la marea de arena y suele aparecer junto a ella. Adems, puede almacenar, amplificar y descargar los poderosos rayos de la tormenta con un efecto devastador. Los Rey Dau son muy territoriales y atacan a cualquier intruso a la vista. El roce de la fulgorita contra su caparazn emite un sonido que pone en guardia a todos los monstruos de la regin.\nSi el ala o la cola de un Rey Dau tocan el suelo mientras estn cargadas, reaccionan generando una capa de fulgorita. Esto no solo aumenta el radio de alcance del apndice, sino tambin la capacidad de carga del monstruo. Destruir ambas partes es primordial. La cabeza tambin suele ser vulnerable tras una descarga. Se recomienda el uso de armadura resistente al rayo y armamento con elemento hielo.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcShIp4ig49CcFDi1NHaveXSaO6w21_qWhW_6A&s','juancarlosfilter@gmail.com','2025-05-22 16:57:55'),(17,'Zoh Shia','Grande','Un Guardin colosal que ha estado alimentndose de la energa de la Tea Dracnida. Su cuerpo est revestido de leche de wyvern cristalizada, lo que le permite regenerarse. El Zoh Shia, al igual que otros Guardianes, destaca por sus ataques de energa y provoca explosiones continuas para cristalizar toda la zona. Bajo su manto blanco de Guardin, su cuerpo palpita energa oscura, la cual podrs observar si revela todo su poder ancestral.\nEl Zoh Shia comparte los rasgos bsicos de otros Guardianes. Si arrancas los cristales de sus alas y cabeza, anulars sus reservas de energa. El cristal blanco de su cuerpo se regenera, pero al hacerlo se vuelve ms quebradizo, lo que facilita destruirlo por segunda vez. Los cristales que crea estallan al recibir dao elemental: aprovchalo con agilidad y municin elemental de la eslinga.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcS147SQRLYIwQDa6W0E9w5oV-pjzPz94mZX1Q&s','juancarlosfilter.infor@gmail.com','2025-05-22 17:03:06'),(18,'Talioth','Pequeo','Carnvoros que merodean por los Llanos Barlovento. Sus inconfundibles mandbulas estn diseadas para aferrar y retener a sus presas y suelen cazar y defenderse en grupo. No es difcil ver a una manada de Talioth enfrentarse a monstruos ms grandes y vencer por superioridad numrica. Los cazadores ms astutos se aprovechan de ello y los usan para distraer o debilitar al objetivo principal.','https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcSQPtnC0QDPjQcoJFrVCrtFn1sia8b1f2X4eg&s','juancarlosfilter.infor@gmail.com','2025-05-22 17:05:00');
/*!40000 ALTER TABLE `custom` ENABLE KEYS */;
