INSERT INTO `monster_base` VALUES (1,'Aptonoth',NULL,'small',NULL,NULL,NULL,'Herbvoros que a menudos sirven como presa de muchos depredadores. Suelen huir en manada.'),(2,'Jagras',NULL,'small',NULL,NULL,NULL,'Monstruos territoriales que, con su carcter grupal, emboscan a otros monstruos en cuanto tienen ocasin.'),(3,'Mernos',NULL,'small',NULL,NULL,NULL,'Dracoalados que viajan en bandadas gigantes. Los cazadores ms hbiles los usan como medio de transporte.'),(4,'Vespoid',NULL,'small',NULL,NULL,NULL,'Sus aguijones son paralizantes. Contienen partes tiles para crear armas venenosas y municin de eslinga.'),(5,'Mosswine',NULL,'small',NULL,NULL,NULL,'Un herbvoro que ha desarrollado un grueso caparazn capaz de protegerle de posibles atacantes.'),(6,'Apceros',NULL,'small',NULL,NULL,NULL,'Monstruos territoriales que, con su carcter grupal, emboscan a otros monstruos en cuanto tienen ocasin.'),(7,'Kestodon',NULL,'small',NULL,NULL,NULL,'Las hembras de Kestodon alertan al grupo de cualquier peligro, mientras los machos cargan violentamente contra cualquier posible amenaza. Bloquea su carga y abrirs sus defensas.'),(8,'Noios',NULL,'small',NULL,NULL,NULL,'Dracoalados que, en caso de asustarse ante una cpsula chillona, producen un sonido similar a explosiones.'),(9,'Gajau',NULL,'small',NULL,NULL,NULL,'Gigantescos monstruos nadadores que patrullan sus aguas con la ferocidad tpica de una criatura de su tamao.'),(10,'Kelbi',NULL,'small',NULL,NULL,NULL,'Dciles herbvoros con cuernos muy apreciados por sus propiedades medicinales.'),(11,'Raphinos',NULL,'small',NULL,NULL,NULL,'Dracoalados que habitan en los Altiplanos Coralinos, en donde se dan autnticos banquetes de huevos.'),(12,'Shamos',NULL,'small',NULL,NULL,NULL,'Pequeos monstruos nocturnos, agresivos y territoriales.'),(13,'Girros',NULL,'small',NULL,NULL,NULL,'Monstruos con mentalidad de grupo que atacan con colmillos paralizantes.'),(14,'Hornetaur',NULL,'small',NULL,NULL,NULL,'Insectos que habitan en tierras diversas. Sus duros caparazones les sirven de proteccin.'),(15,'Gastodon',NULL,'small',NULL,NULL,NULL,'Monstruos con mentalidad grupal muy irritables ante los intrusos. No temen ni a monstruos el doble de grandes.'),(16,'Barnos',NULL,'small',NULL,NULL,NULL,'Dracoalados que sobreviven en dursimas condiciones climticas. Cuentan con un cido letal que pueden escupir.'),(17,'Great Jagras','Fanged Wyvern','large','TRUE','TRUE','TRUE','El voraz lder de los Jagras. Siempre atento y en busca del siguiente almuerzo.'),(18,'Kulu-Ya-Ku','Bird Wyvern','large','TRUE','TRUE','TRUE','Un wyvern pjaro que usa sus extremidades frontales para atacar con todo tipo de recursos.'),(19,'Pukei-Pukei','Bird Wyvern','large','TRUE','TRUE','TRUE','Feroz monstruo que mezcla veneno en sus rganos con plantas para luego escupirlo sobre sus objetivos.'),(20,'Barroth','Brute Wyvern','large','TRUE','TRUE','TRUE','Un monstruo que marca su territorio con barro mientras busca a su aperitivo habitual: las hormigas.'),(21,'Jyuratodus','Piscine Wyvern','large','TRUE','TRUE','TRUE','Gigantesco monstruo nadador que usa el fango a su alrededor no solo como arma, sino tambin como armadura.'),(22,'Tobi-Kadachi','Fanged Wyvern','large','TRUE','TRUE','TRUE','Habitan en las cotas ms altas del Bosque Primigenio y pueden almacenar electricidad esttica en su plumaje.'),(23,'Anjanath','Brute Wyvern','large','TRUE','TRUE','TRUE','Ten cuidado con sus peligrosas patadas y mordiscos. Un monstruo muy agresivo que planta cara a todo.'),(24,'Rathian','Flying Wyvern','large','TRUE','TRUE','TRUE','Reina de la tierra, armada con un veneno letal y con patas capaces de propinar poderossimas patadas.'),(25,'Tzitzi-Ya-Ku','Bird Wyvern','large','TRUE','TRUE','TRUE','Ciega tanto a presas como a enemigos con un rgano especial parpadeante en su cabeza.'),(26,'Paolumu','Flying Wyvern','large','TRUE','TRUE','TRUE','Un devorahuevos de los Altiplanos Coralinos. Libera el aire de su cuerpo para moverse a gran velocidad.'),(27,'Great Girros','Fanged Wyvern','large','TRUE','TRUE','TRUE','Viajan junto a otros Girros menores. Utilizan sus colmillos paralizantes para capturar a sus presas.'),(28,'Radobaan','Brute Wyvern','large','TRUE','TRUE','TRUE','Wyvern brutal recubierto en una armadura de huesos. Se hace una bola para moverse y atacar.'),(29,'Legiana','Flying Wyvern','large','TRUE','TRUE','TRUE','El seor de los Altiplanos Coralinos. Su cuerpo emite un viento helado que ralentiza a su presa.'),(30,'Odogaron','Fanged Wyvern','large','TRUE','TRUE','TRUE','Terrorfico monstruo que recorre el Valle Putrefacto en busca de carroa para llevrsela a su nido.'),(31,'Rathalos','Flying Wyvern','large','TRUE','TRUE','TRUE','El mayor depredador del Bosque Primigenio, que patrulla los cielos en busca de intrusos.'),(32,'Diablos','Flying Wyvern','large','TRUE','TRUE','TRUE','El mandams del Yermo de Agujas. Extremadamente territorial y muy dado a embestir por sorpresa.'),(33,'Kirin','Elder Dragon','large',NULL,NULL,NULL,'Criatura fantasmal que pocos han llegado a ver. Vislumbrar a uno solo puede dejarte boquiabierto.'),(34,'Zorah Magdaros','Elder Dragon','large',NULL,NULL,NULL,'Un dragn anciano cubierto por un caparazn tan gigantesco que es fcil confundirlo con un volcn.'),(35,'Dodogama','Fanged Wyvern','large','TRUE','TRUE','TRUE','Un obeso monstruo que traga minerales sin parar. Su saliva acta como un catalizador explosivo.'),(36,'Pink Rathian','Flying Wyvern','large','TRUE','TRUE','TRUE','Una Rathian revestida de escamas encarnadas. Tiende a atacar con su cola venenosa.'),(37,'Bazelgeuse','Flying Wyvern','large','TRUE','TRUE','TRUE','Monstruo que patrulla el continente entero en bsqueda de presas. Suele esparcir escamas explosivas.'),(38,'Deviljho','Brute Wyvern','large','TRUE','TRUE','TRUE','Un wyvern brutal de apetito insaciable, capaz de agarrar a grandes monstruos en sus fauces y sacudirlos por los aires.'),(39,'Lavasioth','Piscine Wyvern','large','TRUE','TRUE','TRUE','Un violento wyvern nadador que se desplaza por la lava y usa magma endurecido como armadura.'),(40,'Uragaan','Brute Wyvern','large','TRUE','TRUE','TRUE','Monstruo que usa su gigantesca mandbula para machacar los minerales que consume.'),(41,'Azure Rathalos','Flying Wyvern','large','TRUE','TRUE','TRUE','Un Rathalos cubierto de escamas azuladas. Tiende a atacar a sus presas desde el aire.'),(42,'Black Diablos','Flying Wyvern','large','TRUE','TRUE','TRUE','Las escamas de Diablos se oscurecen en poca de apareamiento. Conocidas como las madres del Yermo de Agujas.'),(43,'Nergigante','Elder Dragon','large',NULL,NULL,NULL,'Un terrible dragn anciano consumido por su sed de destruccin. Su propia seguridad no parece preocuparle.'),(44,'Teostra','Elder Dragon','large',NULL,NULL,NULL,'Dragn anciano rodeado de llamas. Un crujido de sus afilados colmillos puede detonar sus escamas dispersas.'),(45,'Kushala Daora','Elder Dragon','large',NULL,NULL,NULL,'Un dragn anciano protegido por feroces rfagas de viento que impiden que nadie se acerque a ellos.'),(46,'Vaal Hazak','Elder Dragon','large',NULL,NULL,NULL,'Poderossimo dragn anciano que vive en los efluvios. Si el vapor llega a disiparse, el monstruo acumula ms.'),(47,'Xenojiiva','Elder Dragon','large',NULL,NULL,NULL,'Informacin no disponible.'),(48,'Kulve Taroth','Elder Dragon','large',NULL,NULL,NULL,'Un dragn anciano recubierto de un manto de oro. Romperle los cuernos requiere seguir varios pasos.'),(49,'Lunastra','Elder Dragon','large',NULL,NULL,NULL,'Un dragn anciano hembra con una corona de cuernos y piel azul. Emite un intenso calor.'),(50,'Behemoth','Elder Dragon','large',NULL,NULL,NULL,'Una bestia de otro mundo. De constitucin muy musculosa y con dos cuernos temibles.'),(51,'Leshen','Relict','large',NULL,NULL,NULL,'Una criatura de otro mundo que vive en lo ms profundo del bosque. Controla a la flora y fauna de su territorio.'),(52,'Ancient Leshen','Relict','large',NULL,NULL,NULL,'Una criatura tan antigua y poderosa que a veces es adorada como una deidad en el mundo del que procede.'),(100,'Gajalaka',NULL,'small',NULL,NULL,NULL,'Informacin no disponible.'),(101,'Popo',NULL,'small',NULL,NULL,NULL,'Informacin no disponible.'),(102,'Anteka',NULL,'small',NULL,NULL,NULL,'Informacin no disponible.'),(103,'Wulg',NULL,'small',NULL,NULL,NULL,'Informacin no disponible.'),(104,'Cortos',NULL,'small',NULL,NULL,NULL,'Informacin no disponible.'),(111,'Beotodus','Piscine Wyvern','large','TRUE','TRUE','TRUE','La cabeza cuneiforme de este wyvern nadador le permite desplazarse con libertad por la nieve del rtico.'),(112,'Banbaro','Brute Wyvern','large','TRUE','TRUE','TRUE','Este monstruo arranca la tierra con sus dos gigantescos cuernos mientras carga contra los enemigos.'),(113,'Viper Tobi-Kadachi','Fanged Wyvern','large','TRUE','TRUE','TRUE','La cola de esta subespecie secreta una toxina, y sus colmillos paralizan a la presa. Planea sin subir a los rboles.'),(114,'Nightshade Paolumu','Flying Wyvern','large','TRUE','TRUE','TRUE','Esta subespecie de Paolumu expulsa rfagas de aire con un potente sedante que provoca sueo.'),(115,'Coral Pukei-Pukei','Bird Wyvern','large','TRUE','TRUE','TRUE','Una subespecie de Pukei-Pukei capaz de expulsar agua almacenada en su cuerpo por la boca y la cola.'),(116,'Barioth','Flying Wyvern','large','TRUE','TRUE','TRUE','Un wyvern volador blanco nveo que habita en el glido rtico. Usa alas y cola para atravesar el hielo.'),(117,'Nargacuga','Flying Wyvern','large','TRUE','TRUE','TRUE','Sumamente gil en el suelo, este wyvern volador de piel de obsidiana se mueve con acelerones explosivos.'),(118,'Glavenus','Brute Wyvern','large','TRUE','TRUE','TRUE','Un wyvern brutal que blande su pesada cola como una espada. Acumula calor con cada golpe hasta ponerse rojo.'),(119,'Tigrex','Flying Wyvern','large','TRUE','TRUE','TRUE','Un wyvern volador salido de la prehistoria, conocido por su rugido ensordecedor y carga abrumadora.'),(120,'Brachydios','Brute Wyvern','large','TRUE','TRUE','TRUE','Un wyvern brutal que usa su saliva para recubrir sus patas delanteras de una baba pegajosa y explosiva.'),(121,'Shrieking Legiana','Flying Wyvern','large','TRUE','TRUE','TRUE','Una variedad de Legiana con el cuerpo cubierto de blanca escarcha. Ataca en picado y con rfagas heladas.'),(122,'Fulgur Anjanath','Brute Wyvern','large','TRUE','TRUE','TRUE','Con cada ataque, esta subespecie de Anjanath fortalece su mandbula y membrana dorsal con electricidad.'),(123,'Acidic Glavenus','Brute Wyvern','large','TRUE','TRUE','TRUE','Una subespecie de Glavenus que con cada golpe de su cola lanza un cido altamente corrosivo.'),(124,'Ebony Odogaron','Fanged Wyvern','large','TRUE','TRUE','TRUE','Una subespecie de Odogaron voraz que transporta a sus presas en la boca y enloquece al empezar a alimentarse.'),(125,'Velkhana','Elder Dragon','large',NULL,NULL,NULL,'Un dragn anciano que lo congela todo a su paso. El vaho de su aliento forma picas de hielo.'),(126,'Seething Bazelgeuse','Flying Wyvern','large','TRUE','TRUE','TRUE','Las escamas de esta variante de Bazelgeuse arden ms de lo normal, y su radio de explosin es mayor.'),(127,'Blackveil Vaal Hazak','Elder Dragon','large',NULL,NULL,NULL,'Una variante de Vaal Hazak cubierta de esporas, que escupen un efluvio txico a cualquiera que se acerque.'),(128,'Namielle','Elder Dragon','large',NULL,NULL,NULL,'Un dragn anciano cubierto de agua. Su cuerpo genera electricidad, que descarga sobre sus enemigos.'),(129,'Savage Deviljho','Brute Wyvern','large','TRUE','TRUE','TRUE','Una variante mutada de Deviljho, enajenado por su hambre insaciable. Intentar comerse a todo lo que vea.'),(130,'Ruiner Nergigante','Elder Dragon','large',NULL,NULL,NULL,'Incontables batallas han fortalecido a este tipo de Nergigante. Sus pas se hacen ms duras al perder salud.'),(131,'Shara Ishvalda','Elder Dragon','large',NULL,NULL,NULL,'Misterioso dragn anciano capaz de manipular vetas de minerales. El vibrar de sus alas remodela la tierra.'),(132,'Zinogre','Fanged Wyvern','large','TRUE','TRUE','TRUE','El rayo fluye por el pelaje de este wyvern de colmillos. Es ms letal en su estado sobrecargado.'),(133,'Yian Garuga','Bird Wyvern','large','TRUE','TRUE','TRUE','Un wyvern pjaro caracterstico por sus escamas negras y duras e impresionante melena. Golpea con su peculiar pico.'),(134,'Scarred Yian Garuga','Bird Wyvern','large','TRUE','TRUE','TRUE','Sus partes se rompen con facilidad y se cansa rpido, como la especie comn, pero su comportamiento es diferente.'),(135,'Brute Tigrex','Flying Wyvern','large','TRUE','TRUE','TRUE','Escamas negruzcas y un potente rugido caracterizan a esta subespecie de Tigrex. Es extremadamente agresivo.'),(136,'Gold Rathian','Flying Wyvern','large','TRUE','TRUE','TRUE','Apenas se han dado avistamientos de esta rara especie de Rathian de escamas doradas.'),(137,'Silver Rathalos','Flying Wyvern','large','TRUE','TRUE','TRUE','Apenas se han dado avistamientos de esta rara especie de Rathalos de escamas plateadas.'),(138,'Rajang','Fanged Beast','large','TRUE','TRUE','TRUE','Muy agresivo y territorial, y capaz de romper trampas elctricas si se enfurece. Puedes parar su furia atacando la cola.'),(139,'Stygian Zinogre','Fanged Wyvern','large','TRUE','TRUE','TRUE','Vive en simbiosis con los bichos dracfagos, que salen disparados de l como balas. Es peligrossimo.'),(140,'Safijiiva','Elder Dragon','large',NULL,NULL,NULL,'La forma adulta de Xeno\'jiiva. Absorbe energa de su entorno para curarse y alterar el ecosistema.'),(141,'Boaboa',NULL,'small',NULL,NULL,NULL,'Informacin no disponible.'),(142,'Furious Rajang','Fanged Beast','large','TRUE','TRUE','TRUE','Variedad de Rajang de melena dorada, an ms agresivos que el Rajang normal. Al enfurecerse hacen saltar chispas.'),(143,'Raging Brachydios','Brute Wyvern','large','TRUE','TRUE','TRUE','Variedad de Brachydios ms grande de lo normal. La baba que recubre su cuerpo se activa y explota con el tiempo.'),(144,'Alatreon','Elder Dragon','large',NULL,NULL,NULL,'Un smbolo de destruccin. Se dice que puede controlar a toda la naturaleza, pero no hay registros sobre ello.'),(145,'Frostfang Barioth','Flying Wyvern','large','TRUE','TRUE','TRUE','Una variedad de Barioth que ralentiza a su presa con un glido ataque de aliento para luego rematarla.'),(146,'Fatalis','Elder Dragon','large',NULL,NULL,NULL,'El legendario dragn negro que en el pasado obliter a una nacin entera en una sola noche y tom su castillo.');
